import React, {useState, useEffect} from 'react'

function Webapp(){

  useEffect(() => {
    const init = {
      method: 'GET',
      headers: {
        AccountKey : 'b5NRmQ28QUSAE/qVP8jx2g==',
      },
    }
    fetch('http://datamall2.mytransport.sg/ltaodataservice/BusArrivalv2?BusStopCode=66211',init)
    .then( res => res.json())
    .then( resdata => console.log(resdata))
  })

  return(
    <div className="section middle-container">
      <h1>Nextbus</h1>
    </div>
  )
}

export default Webapp
